import React from 'react';
import ReactDOM from 'react-dom';


/* 防止注入攻击 */
let num = 1;

setInterval(() => {
    num++;
    const div = (
        <div title="num">
            {num}
        </div>
    );
    console.log(div);
    console.log(div.props.children);
    console.log(div.props.title);
    ReactDOM.render(div, document.getElementById('root'));
}, 1000);
